// @name           d2.vu (new Demonoid) Theme Changer
// @description    Revert d2.vu's website theme back to the old Demonoid theme.
// @version        1.0
// @include        http://www.d2.vu/*
// @match          http://www.d2.vu/*
// ==/UserScript==

// Replace the favicon

function addLink (iconURL, relValue) {
    var link = document.createElement("link");
    link.type = "image/x-icon";
    link.rel = relValue;
    link.href = iconURL;
    document.getElementsByTagName("head")[0].appendChild(link);
}

var icon = 'data:image/x-icon;base64,';

addLink(icon,'icon');

// Remove unneeded <br> tags in footer

var pfooter = document.getElementsByClassName('pfooter');
var pfooter_parent = pfooter[0].parentNode;
var br_tags = pfooter_parent.getElementsByTagName('br');

var br_tags_length = br_tags.length

for (var i = br_tags.length-1; i >= 0; i--)
{
	var node = br_tags[i];
	if (node && i > br_tags_length-7)
	{
		node.parentNode.removeChild (node);
	}
}


